import React from 'react';
import Link from 'next/link';
import Head from 'next/head';
import AppLayOut from '../components/AppLayOut';

const Home = () => {
  return (
    <>
      <Head>
        <title>nodebirld</title>
        <link rel="https://cdnjs.cloudflare.com/ajax/libs/antd/4.0.4/antd.css" />
      </Head>
      <AppLayOut>
        <Link href="/about"><a>about</a></Link>
        <div>Hello, Next!</div>
      </AppLayOut>
    </>
  );
};

export default Home;
